import React, { useState } from "react";

export default function SuperdenseCodingDemo() {
  const [bit1, setBit1] = useState(null);
  const [bit2, setBit2] = useState(null);
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  async function runSimulation() {
    if (bit1 === null || bit2 === null) {
      alert("Select both bits to transmit.");
      return;
    }
    setLoading(true);
    setResult(null);
    try {
      const response = await fetch("http://localhost:5000/simulate", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ bit1, bit2 }),
      });
      const data = await response.json();
      setResult(data);
    } catch (err) {
      alert("Error from backend.");
    }
    setLoading(false);
  }

  return (
    <div style={{ maxWidth: 900, margin: "auto", fontFamily: "Segoe UI, Tahoma, Geneva, Verdana, sans-serif", padding: "1rem" }}>
      {/* Title */}
      <h1 style={{ textAlign: "center", color: "#003366" }}>
        What is Superdense Coding?
      </h1>

      {/* Intro */}
      <p>
        Superdense coding is a quantum communication protocol that allows transmission of <strong>two classical bits</strong> using only <strong>one qubit</strong>, enabled by quantum entanglement. This demo simulates the complete process from entanglement creation to classical bit recovery.
      </p>

      {/* Key Steps */}
      <h3>Key Steps:</h3>
      <ul>
        <li>Create entangled Bell state pair</li>
        <li>Encode 2 classical bits into qubit state</li>
        <li>Transmit single qubit to receiver</li>
        <li>Perform Bell measurement</li>
        <li>Recover original classical bits</li>
      </ul>

      {/* Learning Objectives */}
      <h3>Learning Objectives:</h3>
      <ul>
        <li>Understand quantum entanglement</li>
        <li>Learn quantum gate operations</li>
        <li>See quantum measurement in action</li>
        <li>Grasp quantum information theory</li>
      </ul>

      {/* Interactive Simulation */}
      <section style={{ borderTop: "2px solid #003366", marginTop: "2rem" }}>
        <h2>Interactive Simulation</h2>
        <h3>Choose Classical Bits to Transmit</h3>
        <strong>Current Selection:</strong> {bit1 !== null && bit2 !== null ? `${bit1}${bit2}` : "--"}

        {/* Bit selectors */}
        <div style={{ margin: "1rem 0" }}>
          <label style={{ marginRight: 15 }}>
            Bit 1:{" "}
            <select value={bit1 ?? ""} onChange={e => setBit1(e.target.value)}>
              <option value="" disabled>Select</option>
              <option value="0">0</option>
              <option value="1">1</option>
            </select>
          </label>

          <label>
            Bit 2:{" "}
            <select value={bit2 ?? ""} onChange={e => setBit2(e.target.value)}>
              <option value="" disabled>Select</option>
              <option value="0">0</option>
              <option value="1">1</option>
            </select>
          </label>
        </div>

        {/* Visual Process Representation */}
        <div style={{ margin: "1rem 0" }}>
          <h3>Visual Process Representation</h3>
          <p><strong>Qubit States</strong></p>
          <p>|0⟩ &nbsp;&nbsp;&nbsp; |0⟩</p>

          <h4>Quantum Circuit Diagram</h4>
          <div style={{ display: "flex", justifyContent: "space-around", marginBottom: 15 }}>
            <div>
              <p><strong>Qubit A</strong></p>
              <p>H</p>
              <p>X</p>
              <p>Z</p>
            </div>

            <div>
              <p><strong>Qubit B</strong></p>
              <p>Measurement</p>
              <p>Bell Basis</p>
            </div>
          </div>

          {/* Steps */}
          <ol>
            <li><strong>Entanglement</strong>: Create Bell state Φ⁺ (Waiting...)</li>
            <li><strong>Encoding</strong>: Apply X/Z gates (Waiting...)</li>
            <li><strong>Transmission</strong>: Send qubit A (Waiting...)</li>
            <li><strong>Decoding</strong>: Bell measurement (Waiting...)</li>
          </ol>
        </div>

        {/* Simulation Button */}
        <button
          onClick={runSimulation}
          disabled={loading}
          style={{ 
            backgroundColor: "#003366", 
            color: "white", 
            padding: "10px 25px", 
            borderRadius: 6, 
            border: "none",
            cursor: loading ? "not-allowed" : "pointer",
            marginBottom: "1rem"
          }}
        >
          {loading ? "Simulating..." : "Run Simulation"}
        </button>

        {/* Results */}
        <div style={{ borderTop: "1px solid #333", paddingTop: "1rem" }}>
          <h3>Results</h3>
          <p><strong>Original Bits:</strong> {result ? result.original_bits : "--"}</p>
          <p><strong>Received Bits:</strong> {result ? result.measured_bits : "--"}</p>
        </div>
      </section>

      {/* How it works */}
      <section style={{ marginTop: "3rem", borderTop: "2px solid #003366", paddingTop: "1rem" }}>
        <h2>How Superdense Coding Works</h2>
        <h3>Theoretical Foundation</h3>
        <p>
          Superdense coding leverages quantum entanglement to achieve what's classically impossible: transmitting two bits using one quantum particle. The key is that entangled particles share correlations that exceed classical limits.
        </p>
        <ul>
          <li>Entangled qubits exist in superposition</li>
          <li>Operations on one qubit affect the other instantly</li>
          <li>Bell measurement reveals the encoded information</li>
          <li>No-cloning theorem ensures security</li>
        </ul>

        <h3>Gate Operations</h3>
        <table style={{ width: "100%", borderCollapse: "collapse" }}>
          <thead>
            <tr style={{ textAlign: "left", borderBottom: "2px solid #003366" }}>
              <th>Bits</th>
              <th>X Gate</th>
              <th>Z Gate</th>
              <th>Result</th>
            </tr>
          </thead>
          <tbody>
            <tr><td>00</td><td>No</td><td>No</td><td>Φ⁺</td></tr>
            <tr><td>01</td><td>Yes</td><td>No</td><td>Ψ⁺</td></tr>
            <tr><td>10</td><td>No</td><td>Yes</td><td>Φ⁻</td></tr>
            <tr><td>11</td><td>Yes</td><td>Yes</td><td>Ψ⁻</td></tr>
          </tbody>
        </table>
      </section>
    </div>
  );
}
